import { useState, useEffect } from 'react';
import { Row, Col } from 'react-bootstrap';
import StatisticsWidget from './widget';
// import './App.css';

function App() {

  const [img, setimg] = useState(null);
  useEffect(() => {
    /* global fetch */
    fetch('https://docs.mapbox.com/mapbox-gl-js/assets/earthquakes.geojson')
    const fetchImage = async () => {
      const res = await fetch(`https://storage.googleapis.com/iex/api/logos/${AAPL}.png`);
      const imageBlob = await res.blob();
      const imageObjectURL = URL.createObjectURL(imageBlob);
      setImg(imageObjectURL);
    };
  }, []);

  return (
    <Row>
      <Col xl={3} md={6}>
        <StatisticsWidget symbol="aapl" name="Apple" price="80" dollar_difference="23" percent_difference="0.5%" />
      </Col>
      <Col xl={3} md={6}>
        <StatisticsWidget symbol="tsla" name="Tesla" price="300" dollar_difference="50" percent_difference="2.5%" />
      </Col>
      <Col xl={3} md={6}>
        <StatisticsWidget symbol="amd" name="AMD" price="34" dollar_difference="-12" percent_difference="-3.7%" />
      </Col>
    </Row>
  );
}

export default App;
